import React from 'react'
import TreeCategory from './TreeCategory/TreeCategory'
import TreeItem from './TreeItem/TreeItem'

const TreeChannel = ({ nodeChats, id }) => {
	return (
		<ul>
			{nodeChats.categorys.forEach((value, key) => {
				<TreeCategory category={value} id={key} />
			})}
			(
			{nodeChats.otherChats.forEach(element => {
				<TreeItem item={element} />
			})}
			)
		</ul>
	)
}

export default TreeChannel
